import React from "react";

const DogCard = ({ dog }) => {
  console.log("dog card", dog);
  return (
    <div>
      <h3>Are you working?</h3>
      <li>
        <img alt="" src={dog.img} />
      </li>
    </div>
  );
};

export default DogCard;
